import chessImage from "../assets/chess.png";
import tempImage from "../assets/temp.png";

export const imagesData = [
  {
    img: chessImage,
    title: "Chess",
    isDone: true,
  },
  {
    img: tempImage,
    title: "Checkers",
    isDone: false,
  },
];
